const listStyle = {
  listStyle: 'none',
};

const logoStyle = {
  width : 100,
};

const Partners = () => (
  <div>
  <ul >
    <li><img style={logoStyle} src="../static/partners/amzn_logo.png"></img></li>
    <li><img style={logoStyle} src="../static/partners/alibaba.png"></img></li>
    <li><img style={logoStyle} src="../static/partners/amazon-japan-logo.png"></img></li>
    <li><img style={logoStyle} src="../static/partners/coupang.png"></img></li>
    <li><img style={logoStyle} src="../static/partners/naver.png"></img></li>
    <li><img style={logoStyle} src="../static/partners/Shopee.png"></img></li>
  </ul>
</div>
);

export default Partners;
